DROP TABLE IF EXISTS `sc_user`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `sc_user` (
  `ID` bigint NOT NULL AUTO_INCREMENT,
  `TENANT_ID` bigint NOT NULL,
  `LOGIN_ID` varchar(100) NOT NULL,
  `NAME` varchar(256) NOT NULL,
  `LOGIN_PWD` varchar(256) NOT NULL,
  `PWD_UPDATED_AT` timestamp NULL DEFAULT NULL ON UPDATE CURRENT_TIMESTAMP,
  `LOGIN_FAIL_CNT` int DEFAULT NULL,
  `USER_TYPE` varchar(1) NOT NULL,
  `AUTH_ID` varchar(50) DEFAULT NULL,
  `EMP_ID` bigint DEFAULT NULL,
  `BIZ_ID` bigint DEFAULT NULL,
  `COMP_NM` varchar(50) DEFAULT NULL,
  `LOGIN_YN` varchar(2) DEFAULT NULL,
  `DEPT_ID` varchar(30) DEFAULT NULL,
  `DEPT_NM` varchar(50) DEFAULT NULL,
  `PHONE` varchar(512) DEFAULT NULL,
  `EMAIL` varchar(512) DEFAULT NULL,
  `FAX_NO` varchar(512) DEFAULT NULL,
  `TEL_NO` varchar(512) DEFAULT NULL,
  `SMS_YN` varchar(1) DEFAULT NULL,
  `INFO_AGR_YN` varchar(1) DEFAULT NULL,
  `LOGIN_AT` timestamp NULL DEFAULT NULL ON UPDATE CURRENT_TIMESTAMP,
  `LOGOUT_AT` timestamp NULL DEFAULT NULL ON UPDATE CURRENT_TIMESTAMP,
  `USER_IP` varchar(20) DEFAULT NULL,
  `USER_HOST` varchar(50) DEFAULT NULL,
  `USE_YN` varchar(1) DEFAULT '1',
  `CREATED_AT` timestamp NULL DEFAULT CURRENT_TIMESTAMP,
  `CREATED_BY` varchar(50) DEFAULT NULL,
  `UPDATED_AT` timestamp NULL DEFAULT NULL ON UPDATE CURRENT_TIMESTAMP,
  `UPDATED_BY` varchar(50) DEFAULT NULL,
  `END_AT` timestamp NULL DEFAULT NULL,
  `site_nm` varchar(512) DEFAULT NULL,
  PRIMARY KEY (`ID`),
  UNIQUE KEY `LOGIN_ID_UNIQUE` (`TENANT_ID`,`LOGIN_ID`),
  KEY `FK_SC_USER_EMP_ID` (`EMP_ID`),
  KEY `FK_SC_USER_BIZ_ID` (`BIZ_ID`),
  CONSTRAINT `FK_SC_USER_BIZ_ID` FOREIGN KEY (`BIZ_ID`) REFERENCES `sc_comp_info` (`ID`),
  CONSTRAINT `FK_SC_USER_EMP_ID` FOREIGN KEY (`EMP_ID`) REFERENCES `sc_inner_user_info` (`ID`),
  CONSTRAINT `FK_SC_USER_TENANT_ID` FOREIGN KEY (`TENANT_ID`) REFERENCES `ssc_tenants` (`ID`)
) ENGINE=InnoDB AUTO_INCREMENT=30 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci COMMENT='사용자';
